import React from 'react';
import { Layout } from 'antd';

const { Content } = Layout;
const BookingContent = () => (
  <Layout style={{ padding: '0 24px 24px' }}>
    <Content style={{
      padding: 24,
      margin: 0,
      minHeight: 600,
    }}
    >
      <h1>Hello</h1>
    </Content>
  </Layout>
);

export default  BookingContent;
